import React from "react"
import AddUserForm from "./AddUserForm"
import AddLocationForm from "./AddLocationForm"
function Settings() {
	return (
		<div>
			<h2>Settings</h2>
			<AddUserForm />
			<AddLocationForm />
		</div>
	)
}
export default Settings
